import React, { useState } from "react";
import {
  alpha,
  ThemeProvider,
  withStyles,
  makeStyles,
  createTheme,
} from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import { green } from "@material-ui/core/colors";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexWrap: "wrap",
  },
  margin: {
    margin: theme.spacing(2),
    width: "350px",
  },
}));

const theme = createTheme({
  palette: {
    primary: green,
  },
});

export default function CustomizedInputs() {
  const classes = useStyles();

  // let [locdata, setlocdata] = useState();

  // let handleChange = ({ target }) => {
  //   setlocdata(target.value);
  // };

  // let findebus = () => {
  //   alert(locdata);
  // };
  let [value, setValue] = useState(0);

  let onChangeHandler = (e) => {
    console.log(e.target.value); // here you get onchange value of input
    setValue(e.target.value);
  };

  return (
    <Grid
      container
      className={classes.container}
      direction="column-reverse"
      justifyContent="flex-end"
      alignItems="baseline"
    >
      <Grid item className={classes.input1}>
        <ThemeProvider theme={theme}>
          <TextField
            className={classes.margin}
            label="Urde"
            variant="outlined"
            id="mui-theme-provider-standard-input"
          />
        </ThemeProvider>
      </Grid>
      <Grid item className={classes.input2}>
        <ThemeProvider theme={theme}>
          <TextField
            className={classes.margin}
            label="Urduc"
            variant="outlined"
            id="mui-theme-provider-outlined-input"
            // value={locdata}
            // onChange={handleChange()}
            ref={textInput}
          />
        </ThemeProvider>
        <button value={value} onChange={onChangeHandler}>
          asd
        </button>
      </Grid>
    </Grid>
  );
}
